<style>
    .poppins {
        font-family: "Poppins", sans-serif;
    }
</style>

<div class="fixed top-0 z-40 pt-8 bg-white w-full px-4 pb-3">
    <div class="flex items-center justify-between">
        <a href="/">
            <svg class="w-[182px] h-[68px]" viewBox="0 0 182 68" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <rect width="182" height="68" fill="url(#pattern0_617_538)" />
                <defs>
                    <pattern id="pattern0_617_538" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlink:href="#image0_617_538" transform="matrix(0.000639795 0 0 0.00171563 0 -0.853503)" />
                    </pattern>
                    <image id="image0_617_538" width="1563" height="1563" xlink:href="data:image/png;base64," />
                </defs>
            </svg>
        </a>

        <button id="open-sidebar" onclick="openDrawer()" class="active:scale-95 transition-all duration-100 ease-in-out">
            <svg width="48" height="48" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M32.38 4H15.62C8.34 4 4 8.34 4 15.62V32.36C4 39.66 8.34 44 15.62 44H32.36C39.64 44 43.98 39.66 43.98 32.38V15.62C44 8.34 39.66 4 32.38 4ZM34 34.5H14C13.18 34.5 12.5 33.82 12.5 33C12.5 32.18 13.18 31.5 14 31.5H34C34.82 31.5 35.5 32.18 35.5 33C35.5 33.82 34.82 34.5 34 34.5ZM34 25.5H14C13.18 25.5 12.5 24.82 12.5 24C12.5 23.18 13.18 22.5 14 22.5H34C34.82 22.5 35.5 23.18 35.5 24C35.5 24.82 34.82 25.5 34 25.5ZM34 16.5H14C13.18 16.5 12.5 15.82 12.5 15C12.5 14.18 13.18 13.5 14 13.5H34C34.82 13.5 35.5 14.18 35.5 15C35.5 15.82 34.82 16.5 34 16.5Z" fill="#00BF63" />
            </svg>
        </button>
    </div>
</div>

<div class="fixed top-0 z-40">
    <div id="drawer" class="relative hidden">
        <div onclick="closeDrawer()" id="overlay" class="h-screen w-screen bg-black opacity-15"></div>
        <div id="main-drawer" class="absolute right-0 top-10 z-10 bg-white h-[90vh] w-[300px] rounded-l-[30px] py-7 translate-x-full transform duration-500" style="box-shadow:-10px 4px 22.7px 0px #00000040;">
            <button onclick="closeDrawer()" class="px-5 active:scale-95 transition-all duration-100 ease-in-out">
                <svg width="47" height="47" viewBox="0 0 47 47" fill="none" xmlns="http://www.w3.org/2000/svg">
                    <path d="M19.5833 27.4167L23.5 23.5M23.5 23.5L27.4167 19.5833M23.5 23.5L19.5833 19.5833M23.5 23.5L27.4167 27.4167M41.125 23.5C41.125 33.234 33.234 41.125 23.5 41.125C13.766 41.125 5.875 33.234 5.875 23.5C5.875 13.766 13.766 5.875 23.5 5.875C33.234 5.875 41.125 13.766 41.125 23.5Z" stroke="#374151" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" />
                </svg>
            </button>

            @include('Components.Navbar.pic.item-pic')
            @include('Components.Navbar.spv.item-spv')
        </div>
    </div>
</div>

<script async>
    let drawer = document.getElementById('drawer')
    let mainDrawer = document.getElementById('main-drawer')

    function openDrawer() {
        drawer.classList.remove('hidden')
        mainDrawer.classList.remove('translate-x-full')
    }

    function closeDrawer() {
        drawer.classList.add('hidden')
        mainDrawer.classList.add('translate-x-full')
    }
</script>